    },
    {
      "id": 4,
      "title": "Womens",
      "imageUrl": "https://images.unsplash.com/photo-1627483297929-37f416fec7cd?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxzZWFyY2h8MXx8ZmFzaGlvbnxlbnwwfHwwfHw%3D&w=1000&q=80"
    },
    {
      "id": 5,
      "title": "Mens",
      "imageUrl": "https://i.pinimg.com/736x/26/e6/78/26e6787c1c738b1e110fba0c3d3b5bc7--fashion-lookbook-fashion-.jpg"
    }
  ]
  return (
      <Directory categories={categories}/>
  );
}

export default App;
